import './App.css';
import mePhoto from './meimg.jpg';
let datas = require('./info.json');

let bio = document.getElementById('aboutme');

fetch(data)
  .then((res) => res.json())
  .then((data) => bio.innerHTML = data.Aboutme);

function App() {
  return (
    <div className="App">
      {/* head */}
      <div id="heads">

        <div>
          <h1>[-]</h1>
        </div>

        <div id="links">
          <span> <h3>Games</h3></span>
          <span> <h3>Music</h3></span>
          <span> <h3>Other Links</h3></span>
        </div>

      </div>

      {/* body */}
      <div id="body">
        <div>
          <img src={mePhoto} alt={'me'} />
        </div>
        <div>
          <p id="aboutme">This has a bio to it</p>

        </div>
      </div>

      {/* footer */}
      <div id="footer">
        <span> <h1>[-]</h1></span>
        <span>
          <p>Instagram</p>
          <p>LinkedIn</p>
          <p>Twitter</p>
        </span>
        <span> <p>Tic Tac Toe</p></span>
      </div>

    </div>
  );
}

export default App;
